  `is_active` tinyint(1) NOT NULL DEFAULT '0' COMMENT '合同是否生效',
  `signed_date` date DEFAULT NULL COMMENT '签署日期',
  `payee_name` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '收款人名称',
  `payee_account` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '收款人账号',
  `bank_name` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '银行名称',
  `bank_address` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '银行地址',
  `swift_code` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'SwiftCode',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录创建时间',
  PRIMARY KEY (`contract_id`),
  UNIQUE KEY `contract_number` (`contract_number`),
  KEY `customer_id` (`customer_id`),
  CONSTRAINT `rs_contracts_ibfk_1` FOREIGN KEY (`customer_id`) REFERENCES `rs_customers` (`customer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='合同管理表';

